import CSS from "csstype";

export const progressBar: CSS.Properties = {
    appearance: "none", 
    borderRadius: "5px", 
    width: "5%",   // Correctly quoted percentage
    height: "30px", // Added height for thickness
    marginTop: "20px"
};
